// 
// Scripts for the theme,
// slideshow is used for Home Alt #4 (index4.html)
// services is used for Services (services.html)
//



$(function () {
  slideshow.initialize();

  services.initialize();

  contactForm.initialize();

  registrationForm.initialize();


  // retina display
  if (window.devicePixelRatio >= 1.2) {
    $("[data-2x]").each(function () {
      if (this.tagName == "IMG") {
        $(this).attr("src", $(this).attr("data-2x"));
      } else {
        $(this).css({"background-image": "url(" + $(this).attr("data-2x") + ")"});
      }
    });
  }

  // "50% off" image -> link to /prices
  $('#home #hero .img, #home #hero .sale-spot').on('click', function () {
    window.location.href = '/prices';
  });
});

window.utils = {
  isFirefox: function () {
    return navigator.userAgent.toLowerCase().indexOf('firefox') > -1;
  }
};

var contactForm = {
  initialize: function () {
    var $contactForm = $("#contact-form");
    if (!$contactForm.length) {
      return;
    }

    $contactForm.validate({
      rules: {
        "name": {
          required: true
        },
        "email": {
          required: true,
          email: true
        },
        "message": {
          required: true
        }
      },
      highlight: function (element) {
        $(element).closest('.form-group').removeClass('success').addClass('error')
      },
      success: function (element) {
        element.addClass('valid').closest('.form-group').removeClass('error').addClass('success')
      }
    });
  }
};

var services = {
  tabs: function () {
    $tabs = $("#services #tabs");
    $hexagons = $tabs.find(".hexagon");
    $sections = $tabs.find(".section");

    $hexagons.click(function () {
      $hexagons.removeClass("active");
      $(this).addClass("active");
      var index = $hexagons.index(this);
      $sections.fadeOut();
      $sections.eq(index).fadeIn();
    });
  },
  screenHover: function () {
    $screens = $("#features-hover .images img");
    $features = $("#features-hover .features .feature");
    $features.mouseenter(function () {
      if (!$(this).hasClass("active")) {
        $features.removeClass("active");
        $(this).addClass("active");
        var index = $features.index(this);
        $screens.stop().fadeOut();
        $screens.eq(index).fadeIn();
      }
    });
  },
  initialize: function () {
    this.tabs();
    this.screenHover();
  }
};

var slideshow = {
  initialize: function () {
    var $slideshow = $(".slideshow"),
      $slides = $slideshow.find(".slide"),
      $btnPrev = $slideshow.find(".btn-nav.prev"),
      $btnNext = $slideshow.find(".btn-nav.next");

    var index = 0;
    var interval = setInterval(function () {
      index++;
      if (index >= $slides.length) {
        index = 0;
      }
      updateSlides(index);
    }, 4500);

    $btnPrev.click(function () {
      clearInterval(interval);
      interval = null;
      index--;
      if (index < 0) {
        index = $slides.length - 1;
      }
      updateSlides(index);
    });

    $btnNext.click(function () {
      clearInterval(interval);
      interval = null;
      index++;
      if (index >= $slides.length) {
        index = 0;
      }
      updateSlides(index);
    });

    $slideshow.hover(function () {
      $btnPrev.addClass("active");
      $btnNext.addClass("active");
    }, function () {
      $btnPrev.removeClass("active");
      $btnNext.removeClass("active");
    });


    function updateSlides(index) {
      $slides.removeClass("active");
      $slides.eq(index).addClass("active");
    }
  }
};

var registrationForm = {
  initialize: function () {
    var $registrationForm = $("#new_abb_user, #new_bb_user, #edit_user");
    if (!$registrationForm.length) {
      return;
    }

    var filter_input = [
      '#abb_user_full_name',
      '#bb_user_full_name',
      '#user_full_name'
    ];

    $registrationForm.find(filter_input.join(',')).each(function (e) {
      $(this).on('input', function () {
        $(this).val($(this).val().replace(/[\?%\'\"\\\/]/g, ''));
      });
    });

    var filter_input_length_70 = [
      '#abb_user_full_name',
      '#bb_user_full_name',
      '#user_full_name'
    ];

    this.filterLength($registrationForm, filter_input_length_70, 70);
  },

  filterLength: function (form, list, length) {
    form.find(list.join(',')).each(function (e) {
      $(this).on('input', function () {
        $(this).closest('.form-group').find('span.size-error, span.help-block').remove();
        if($(this).val().length > length) {
          var label = $(this).closest('.form-group').find('label').text();
          var message = '';
          if (list.join(',').indexOf('full_name') >= 0) {
            message = $.sprintf(I18n.t('validation.too_long_fio'), label, length);
          } else {
            message = $.sprintf(I18n.t('validation.too_long'), label, length);
          }
          var hint = $('<span></span>').addClass('size-error').text(message);
          $(this).closest('.form-group').append(hint);
        }
      });
    });
  }
};
