(function() {
  var filterBkAndClone, fixTree, tableStripped;

  filterBkAndClone = function() {
    var clonesToShow, countryCode, showClones;
    showClones = $('#showClones').prop('checked');
    countryCode = $('#bookmakerCountryCode').val();
    if (!!countryCode) {
      $(".bk_row, .clone_row").fadeOut(500);
      if (showClones) {
        clonesToShow = $(".clone_row[data-country-code=" + countryCode + "]");
        $(".bk_row[data-country-code=" + countryCode + "]").fadeIn(500);
        clonesToShow.each(function(_, clone) {
          var bkId;
          bkId = $(clone).data('bk-id');
          $(".bk_row[data-bk-id=" + bkId + "]").fadeIn(500);
          return $(clone).fadeIn(500);
        });
      } else {
        $(".bk_row[data-country-code=" + countryCode + "]").fadeIn(500);
      }
    } else {
      $(".bk_row").fadeIn(500);
      if (showClones) {
        $(".clone_row").fadeIn(500);
        $(".hasClones").addClass('active-row');
      } else {
        $(".clone_row").fadeOut(500);
        $(".hasClones").removeClass('active-row');
      }
    }
    return setTimeout(function() {
      tableStripped();
      fixTree();
      if ($('.bk_row:visible').length > 0) {
        return $('.no_bk').fadeOut(500);
      } else {
        return $('.no_bk').fadeIn(500);
      }
    }, 500);
  };

  tableStripped = function() {
    return $('.bk_list_table tbody tr:visible').each(function(k, row) {
      $(row).removeClass('odd');
      if (k % 2 === 0) {
        return $(row).addClass('odd');
      }
    });
  };

  fixTree = function() {
    var visible_rows;
    visible_rows = $('.bk_list_table tbody tr:visible');
    if (visible_rows.length < 2) {
      $('.hasClones.active-row .holder-icon').addClass('noAfter');
    }
    return visible_rows.each(function(k, row) {
      row = $(row);
      row.find('.holder-icon').removeClass('noAfter');
      row.removeClass('last-clone');
      if (row.hasClass('hasClones')) {
        if (k === visible_rows.length - 2 || $(visible_rows.get(k + 1)).hasClass('bk_row')) {
          return row.find('.holder-icon').addClass('noAfter');
        }
      } else if (row.hasClass('clone_row')) {
        if (k === visible_rows.length - 2 || $(visible_rows.get(k + 1)).hasClass('bk_row')) {
          return row.addClass('last-clone');
        }
      }
    });
  };

  $(function() {
    tableStripped();
    return $('#showClones, #bookmakerCountryCode').on('change', filterBkAndClone);
  });

}).call(this);
(function() {
  $(function() {
    $(document).on('click', '.toggle-password', function() {
      var input;
      $(this).toggleClass("active");
      input = $($(this).attr('toggle'));
      if (input.attr('type') === 'password') {
        input.attr('type', 'text');
      } else {
        input.attr('type', 'password');
      }
    });
  });

}).call(this);
