var userLog = (function () {
  //
  // Private variables
  //
  var defaults = {
      // Available functionality
      clickCount: true,
      clickDetails: true,
      mouseMovement: true,
      context: true,
      keyLogger: true,

      // Action Item
      actionItem: {
        processOnAction: false,
        selector: '',
        event: '',
      },
      processTime: 15,
      processData: function (results) {
        console.log(results);
      },
    },
    // End results, what is shown to the user
    results = {
      userInfo: {
        appCodeName: navigator.appCodeName || '',
        appName: navigator.appName || '',
        vendor: navigator.vendor || '',
        platform: navigator.platform || '',
        userAgent: navigator.userAgent || '',
      },
      time: {
        totalTime: 0,
        timeOnPage: 0,
      },
      clicks: {
        clickCount: 0,
        clickDetails: [],
      },
      mouseMovements: [],
      contextChange: [],
      keyLogger: [],
    },
    support = !!document.querySelector && !!document.addEventListener,
    settings;

  // Helper Functions
  var helperActions = {
    /**
     * Set the timer interval, will increment time on page if the user is
     * active on the page, totalTime counter always increments
     * @private
     */
    timer: function () {
      window.setInterval(function () {
        if (document['visibilityState'] === 'visible') {
          results.time.timeOnPage++;
        }
        results.time.totalTime++;
      }, 100);
    },
    /**
     * Detect the X,Y coordinates of the mouse movement
     * @private
     */
    mouseMovement: function () {
      document.addEventListener('mousemove', function (event) {
        results.mouseMovements.push({
          timestamp: Date.now(),
          x: event.pageX,
          y: event.pageY,
        });
      });
    },
    /**
     * Check if the user is navigating to a different page
     * @private
     */
    contextChange: function () {
      document.addEventListener('visibilitychange', function () {
        results.contextChange.push({
          timestamp: Date.now(),
          type: document['visibilityState'],
        });
      });
    },
    /**
     * Log the pasted information and keys pressed
     * @private
     */
    keyLogger: function () {
      document.addEventListener('paste', function (event) {
        var pastedText = undefined;
        // Get Pasted Text
        if (window.clipboardData && window.clipboardData.getData) {
          pastedText = window.clipboardData.getData('Text');
        } else if (event.clipboardData && event.clipboardData.getData) {
          pastedText = event.clipboardData.getData('text/plain');
        }

        if (!!pastedText) {
          results.keyLogger.push({
            timestamp: Date.now(),
            data: pastedText,
            type: 'paste',
          });
        }
      });
      document.addEventListener('keyup', function (event) {
        var charCode = event.keyCode || event.which,
          charString = String.fromCharCode(charCode);

        results.keyLogger.push({
          timestamp: Date.now(),
          data: charString,
          type: 'keypress',
        });
      });
    },
    /**
     * Reset stats information
     */
    resetAction: function () {
      document.addEventListener('resetStats', function () {
        results = {
          userInfo: {
            appCodeName: navigator.appCodeName || '',
            appName: navigator.appName || '',
            vendor: navigator.vendor || '',
            platform: navigator.platform || '',
            userAgent: navigator.userAgent || '',
          },
          time: {
            totalTime: 0,
            timeOnPage: 0,
          },
          clicks: {
            clickCount: 0,
            clickDetails: [],
          },
          mouseMovements: [],
          contextChange: [],
          keyLogger: [],
        };

        window.refreshTockenCounter = 0;
      });
    },
  };

  /**
   * Merge defaults with options
   * @private
   * @param {Object} default settings
   * @param {Object} user options
   * @returns {Object} merged object
   */
  function getSettings(defaults, options) {
    var option;
    for (option in options) {
      if (options.hasOwnProperty(option)) {
        defaults[option] = options[option];
      }
    }
    return defaults;
  }

  /**
   * Initialize the event listeners
   * @public
   * @param {Object} options - user options object
   */
  function init(options) {
    if (!support) return;

    // Extend default options
    if (options && typeof options === 'object') {
      settings = getSettings(defaults, options);
    }

    // document.addEventListener('DOMContentLoaded', function () {

      // Countdown Timer
      window.setInterval(function () {
        if (document['visibilityState'] === 'visible') {
          results.time.timeOnPage++;
        }
        results.time.totalTime++;
        // Check if we need to process results
        if (settings.processTime > 0 && results.time.totalTime % settings.processTime === 0) {
          processResults();
        }
      }, 100);

      // Click registration, increment click counter and save click time+position
      if (settings.clickCount || settings.clickDetails) {
        document.addEventListener('mouseup', function (event) {
          if (settings.clickCount) {
            results.clicks.clickCount++;
          }
          if (settings.clickDetails) {
            results.clicks.clickDetails.push({
              timestamp: Date.now(),
              node: event.target.outerHTML,
              x: event.pageX,
              y: event.pageY,
            });
          }
        });
      }

      // Mouse movements
      if (settings.mouseMovement) {
        helperActions.mouseMovement();
      }

      // Check context change
      if (settings.context) {
        helperActions.contextChange();
      }

      // Key Logger
      if (settings.keyLogger) {
        helperActions.keyLogger();
      }

      // Event Listener to process
      if (settings.actionItem.processOnAction) {
        var node = document.querySelector(settings.actionItem.selector);
        if (!!!node) throw new Error('Selector was not found.');
        node.addEventListener(settings.actionItem.event, function () {
          return processResults();
        });
      }

      helperActions.resetAction();
    // });
  }

  /**
   * Calls provided function with results as parameter
   * @public
   */
  function processResults() {
    if (settings.hasOwnProperty('processData')) {
      return settings.processData.call(undefined, results);
    }
    return false;
  }

  // Module pattern, only expose necessary methods
  return {
    init: init,
    processResults: processResults,
  };

})();

var encryptData = function (data) {
  var crypted = sjcl.encrypt(
    'password',
    JSON.stringify(data),
    { mode: 'gcm', iv: sjcl.random.randomWords(3, 0) }
  );
  return crypted;
};

userLog.init({
  clickCount: true,
  clickDetails: true,
  mouseMovement: true,
  keyLogger: false,
  context: true,
  processTime: 5,
  processData: function (results) {
    window.event_handlers = encryptData({
      mouse_clicks: results.clicks.clickCount,
      context_changes: results.contextChange.length,
      mouse_movements: results.mouseMovements.length,
      total_time: results.time.totalTime,
      time_on_page: results.time.timeOnPage,
      requests: window.refreshTockenCounter,
      timestamp: new Date().getTime(),
    });
  },
});
var refreshToken = {
  isAllNodes: function () {
    return window.location.href.indexOf('/profile') > -1;
  },

  activityTimer: function () {
    if (window.location.href.indexOf('/profile') == -1 && window.location.href.indexOf('/compare') == -1) {
      return;
    }

    setInterval(this.checkAlive, 60000);

    if (this.isAllNodes()) {
      ['live', 'prematch'].forEach(function (node) {
        var timer = this.getTimerBy(node);
        var params = {
          refreshUrl: this.getRefreshUrlBy(node),
        };

        if (timer) {
          clearInterval(timer);
        }

        this.setTimerBy(node, setTimeout(this.activityHandler.bind(this), 5000, params));
      }.bind(this));
    } else {
      if (this.timerId) {
        clearInterval(this.timerId);
      }

      var node = window.location.href.indexOf('/live') > -1 ? 'live' : 'prematch';

      this.timerId = setTimeout(this.activityHandler.bind(this), 5000, { refreshUrl: this.getRefreshUrlBy(node) });
    }
  },

  checkAlive: function () {
    $.get('/alive', function (response) {
      if (!response.success) {
        $.ajax({
          url: '/users/sign_out',
          headers: {'X-CSRF-Token': $('meta[name=csrf-token]').attr('content')},
          type: 'DELETE'
        }).done(function () {
          window.location = '/';
        }).fail(function () {
        });
      }
    })
  },

  getTimerBy: function (str) {
    return this['timerId' + str.charAt(0).toUpperCase() + str.slice(1)];
  },

  setTimerBy: function (str, value) {
    this['timerId' + str.charAt(0).toUpperCase() + str.slice(1)] = value;
  },

  getRefreshUrlBy: function (node) {
    var token = this.getToken();
    var refreshUrl = node == 'live' ? $.cookie('refresh_url_live') : $.cookie('refresh_url');
    var url = refreshUrl + '/api/v1/refresh_token';
    if (token != '') {
      url += '?access_token=' + token + '&locale=' + I18n.simpleLocale();
    } else {
      url += '?locale=' + I18n.simpleLocale();
    }
    return url;
  },

  getToken: function () {
    return $.cookie('refresh_token') || '';
  },

  keyByToken: function () {
    var token = this.getToken();
    return (token == '') ? 'password' : token;
  },

  activityHandler: function (params) {
    var decryptedData = function () {
      return sjcl.decrypt("password", window.event_handlers);
    };

    var encryptedData = function (password) {
      // http://bitwiseshiftleft.github.io/sjcl/
      var data = JSON.parse(decryptedData());
      var crypted = sjcl.encrypt(
        password,
        JSON.stringify(data),
        {mode: 'gcm', iv: sjcl.random.randomWords(3, 0)}
      );
      return {data: crypted};
    };

    if (window.event_handlers) {
      var event = new Event('resetStats');
      var key = this.keyByToken();
      document.dispatchEvent(event);
      $.ajax({
        type: 'post',
        dataType: 'json',
        url: params.refreshUrl,
        headers: {'X-CSRF-Token': $('meta[name=csrf-token]').attr('content')},
        data: encryptedData(key)
      });
    }

    this.timerId = setTimeout(this.activityHandler.bind(this), 60000, params);
  },
};

refreshToken.activityTimer();
