$(document).ready(function () {
  if (window.is_blocked_for_russia) {
    $("a.check_for_russia").removeAttr("target").on('click', function() {
      $('.containerForBlockMessage').load('/blocked_page_modal', function () {
        $('.modalBlockPage').modal('show');
      });

      return false;
    });
  }

  $(document).on('click', '.scrollTo', function (e) {
    var target = $(e.target);
    $('body').scrollTo(target.data('scroll'), 500);
    return false;
  });

  $(document).on('click', '.close-btn', function (e) {
    var target = $(e.target);
    target.parents('.message').hide(500);
    return false;
  });
});
